@GeneratorDelegateClass(componentType="AP", descriptionKey="GeneratorDelegateClass.LKM_Oracle_ERP_Cloud_to_SQL")
public class LKM_Oracle_ERP_Cloud_to_SQL extends OracleErpCloudExtractBaseKM {

  protected String fullTableName;
  protected String tableName;
  protected String tableAlias;
  protected List<Column> colList;
  protected List<ISelectItem> selectExprList;
  protected List<Column> tgtColumnList;
  protected SqlQuery tgtSelectQuery;
  protected boolean initTargetAST;
  protected String collTableAccessName;
  protected String [] partitionInfo;

  private Binding mBinding = null;

        @Override
  public void setBinding(Binding binding) {
    super.setBinding(binding);
    mBinding = binding;

    try {
      outputFile = srcSchema + File.separator + erpDS.getResourceName();
      mBinding.setVariable("outputFile", outputFile);

      fullTableName = physicalNode.getSQLAccessName();
      tableName = physicalNode.getStageTableName();
      tableAlias = physicalNode.getStageTableAlias();
      if (component != null &&  component.getComponentType().isDataStorageComponent())
        partitionInfo = ((DataStorageDelegate)component).getPartitionInfo();
    } catch (Exception ex) {
      throw new RuntimeException(ex);
    }

  }

  // class constructor; initialization is done in setBinding method
  public LKM_Oracle_ERP_Cloud_to_SQL() {}      

  private List<ISelectItem> getSelectExprList(String tableAlias) throws MappingException, AdapterException {
    List<ISelectItem> result = new ArrayList<ISelectItem>();
    List<MapPhysicalColumn> cols = physicalNode.getPhysicalColumns();
    for (MapPhysicalColumn col : cols) {
                // For regular physical columns, the reference object will be the original source attribute.
                // For columns that wrap pushed physical expressions, the reference object will be the original logical expression.  
                // The attribute cannot be used because each attribute might have multiple expression (e.g. set component),
                // which leads to ambiguity if the attribute is used as the ref object.
      result.add(new StringExpression(col.getSQLAccessName(tableAlias), col, col.getRefObject()));
    }
    // Handle AP Node journalized source
    MapPhysicalNode jrnSource = generatorContext.getAPNodeJournalizedSource();
    if (jrnSource != null) {
      JRNInfo jrnInfo = generatorContext.getJRNInfo(jrnSource, jrnSource.getExecutionTechnology());
      // add journalizing columns into select list.
      if (jrnInfo != null && jrnInfo.hasJrn()) {
        List<IColumn> virtualColumns = null;
        virtualColumns = jrnInfo.getJRNVirtualColumns();
        String jrnTableName = tableAlias + ".";
        if (virtualColumns != null) {
          for (IColumn virtCol : virtualColumns) {
            // for each phys column (attribute), create an array expression node that represents a simple reference to the attribute
            result.add(new StringExpression(jrnTableName + virtCol.getName(), null));
          }
        }
      }
    }
    // Add extra expressions for expressions that have been pushed up or downstream to this execution unit/PAP
    //      List<MapPhysicalExpression> physExprs = physicalNode.getPushedToExpressions();
    //      for (MapPhysicalExpression physExpr : physExprs) {
    //              result.add(new ArrayExpression(physicalNode, physExpr, (SqlQuery)null));
    //      }

    return result;
  }

  private List<Column> getTgtColList(Table tgtTab) throws MappingException, AdapterException {
    List<Column> result = new ArrayList<Column>();

    JRNInfo jrnInfo = generatorContext.getJRNInfo();
    List<IColumn> virtualColumns = null;
    if (jrnInfo != null && jrnInfo.hasJrn()) {
      virtualColumns = jrnInfo.getJRNVirtualColumns();
    }
    List<MapPhysicalColumn> cols = physicalNode.getPhysicalColumns();
    for (MapPhysicalColumn col : cols) {
      // Convert SDK MapPhysicalColumn objects to list of query tree Column object
      result.add(Column.getColumn(tgtTab, col));
    };

    if (virtualColumns != null) {
      for (IColumn virtCol : virtualColumns) {
        result.add(Column.getColumn(tgtTab, virtCol));
      }
    }

    return result;
  }

  private SqlQuery getTgtSelectQuery(SqlQuery inputQuery) throws MappingException, GenerationException, AdapterException {
    List<ISelectItem> newSelectList = new ArrayList<ISelectItem>();
    List<StringExpression> newAliasList = new ArrayList<StringExpression>();
    List<MapPhysicalColumn> cols = physicalNode.getPhysicalColumns();
    for (MapPhysicalColumn col : cols) {
      // for each phys column (attribute), create an array expression node that represents a simple reference to the attribute
      newSelectList.add(new ArrayExpression(col, inputQuery));
      newAliasList.add(new StringExpression(col.getName(), col));
    }

    JRNInfo jrnInfo = generatorContext.getJRNInfo();
    List<IColumn> virtualColumns = null;
    if (jrnInfo != null && jrnInfo.hasJrn()) {
        virtualColumns = jrnInfo.getJRNVirtualColumns();
            if (virtualColumns != null) {
                String jrnTableName = inputQuery instanceof SetQuery ? "" : inputQuery.getAliasName(false, null) + ".";
                for (IColumn virtCol : virtualColumns) {
                // for each phys column (attribute), create an array expression node that represents a simple reference to the attribute
                newSelectList.add(new StringExpression(jrnTableName + virtCol.getName(), null));
                newAliasList.add(new StringExpression(virtCol.getName(), null));
                }
            }
    }

    SqlQuery result = inputQuery.clone();
    result.setSelectList(newSelectList);
    result.setAliasList(newAliasList);
    return result;
  }

  // Create properties that reflect the component KM option values for the physical target node
  private void initTargetAST(SqlInsertStatement insertStmt) throws AdapterException, MappingException, GenerationException {
    List<IOptionValue> optValues = physicalNode.getOptionValues("TARGET");
    for (IOptionValue optValue : optValues) {
      insertStmt.setPropertyValue(optValue.getName(), optValue.getOptionValue());
    }
  }

@ASTProducerMethod(processingType=ProcessingType.SOURCE, producedASTType=SqlQuery.class, styleKey="ProcessingStyleKey.LKM_Oracle_ERP_Cloud_to_SQL.SELECT")
  AbstractSyntaxTree SELECT() throws MappingException, AdapterException, GenerationException {
    // inputs are ignored for source query formation
    SqlQuery result = createNewQueryForSelect(physicalNode.getTemplateUtils(true));
    // Get the previously stored collection table name for use in downstream select.  
    // "generatorContext" is a predefined variable.
    String accessName = generatorContext.getAPNodeCollTableAccessName();
    Table srcTable = new Table(tableName, null, accessName, physicalNode);
    // Pass along the journalized source node to the staged query, if any.
    MapPhysicalNode jrnSource = generatorContext.getAPNodeJournalizedSource();
    result.setJournalizedSource(jrnSource);
    String tableAliasSeparator = physicalNode.getExecutionTechnology().getTableAliasSeparator();
    FromClause from = new FromClause(new TableReference(srcTable), tableAlias, tableAliasSeparator == null ? " " : tableAliasSeparator);
    List<FromClause> fromList = new ArrayList<FromClause>();
    fromList.add(from);
    result.setFromList(fromList);
    result.setSelectList(getSelectExprList(tableAlias));


    return result;
  }

  public SqlQuery createNewQueryForSelect(TemplateUtils templateUtils) {
    return new SqlQuery(templateUtils);
  }

  @ASTProducerMethod(processingType=ProcessingType.TARGET, producedASTType=AgentStreamingInsertStatement.class, styleKey="ProcessingStyleKey.LKM_Oracle_ERP_Cloud_to_SQL.INSERT")
  public AbstractSyntaxTree INSERT(SqlQuery input) throws AdapterException, MappingException, GenerationException {
    // Get the previously stored collection table name for use in downstream select.  
    // "generatorContext" is a predefined variable.
    SqlQuery input2 = null;
    if (input != null) {
      input2 = input.clone();
      input2.setSuffix("");
    }
    String accessName = generatorContext.getAPNodeCollTableAccessName();
    generatorContext.setAPNodeUpstreamQuery(accessName, input2);
    MapPhysicalNode jrnSource = input2.getJournalizedSource();
    generatorContext.setAPNodeJournalizedSource(jrnSource);
    String tableQualifier = OdiRef.getNodeLogicalSchemaName(physicalNode);
    Table tgtTable = new Table(tableName, tableQualifier, accessName);
    tgtTable.setSourcePhysicalNode(this.physicalNode);
    if (partitionInfo != null && partitionInfo[0] != null && partitionInfo[0].length() > 0) {
        tgtTable.setTableProperty("PARTITION_NAME",partitionInfo[0]);
        tgtTable.setTableProperty("PARTITION_TYPE",partitionInfo[1]);
      }
    AgentStreamingInsertStatement result =
      new AgentStreamingInsertStatement(physicalNode, tgtTable, getTgtColList(tgtTable), getTgtSelectQuery(input2));
    initTargetAST(result);
    return result;
  }

  public String readinfile(String fileName, String indexStr) throws Exception {
    File inFile = new File(fileName);
    BufferedReader reader = new BufferedReader( new InputStreamReader( new FileInputStream(inFile), "UTF8"));
    StringBuffer xmlContentBuf = new StringBuffer();
    String str;
    while ((str = reader.readLine()) != null) {
      xmlContentBuf.append(str);
    }
    reader.close();

    String xmlContent = xmlContentBuf.toString();
    int first = xmlContent.indexOf(indexStr);
    int last = xmlContent.lastIndexOf(indexStr);
    String enclosedData = xmlContent.substring(first+indexStr.length()+1, last-6);

    return enclosedData;
  }

